(13, 1, '2018-01-12 19:02:10', '2018-01-13 00:02:10', 'Welcome to the portfolio website of Craig Peters.I\'m an aspiring graphic designer/part-programmer specializing many aspects of design such as: Web, Logo, Magazine, and Graphic Design. I also have some Web Development training but only a little.', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2018-02-28 14:46:18', '2018-02-28 22:46:18', '', 0, 'http://localhost/?page_id=13', 1, 'page', '', 0),
