(18, 1, '2018-01-12 19:02:51', '2018-01-13 00:02:51', 'I\'m Craig Peters, an aspiring Graphic and Web Designer. I currently call Comox/Courtney on Vancouver Island, British Columbia (BC) my home. Recently I graduated from North Island College with the Communication &amp; Design - Interactive Media Diploma.\r\n\r\nI am currently focused on finding work, and building up my experience on personal projects.\r\n\r\nBorn on February 6 1990, I grew up in the city of Powell River, Canada\'supper Sunshine Coast of British Columbia. After spending a few years gaining work experience and money for college, I moved to Vancouver Island to attend classes at North Island College.\r\n\r\n<a href=\"https://docs.google.com/document/d/e/2PACX-1vSC6eQ-s9XLU6UixJTOdb-3SHlg8QGCJW6ZIGHBcJACh2Ou3ODg09nbQGhR_Lr7rhkHijKD-8x6YHu0/pub\" target=\"_blank\" rel=\"noopener\">Craig Peters Designer Resume</a>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2018-02-28 15:43:35', '2018-02-28 23:43:35', '', 0, 'http://localhost/?page_id=18', 4, 'page', '', 0),
