(1830, 1, '2018-01-25 15:53:36', '2018-01-25 23:53:36', 'This is my First IMG-208 Communication &amp; Design 2 Project. The assignment was to make an info graphic and I decided to try making one with no body text as a sort of challenge to myself.\r\n\r\nThe purpose of this fishing poster is to inform any aspiring fisherman of what the basics necessities involved.\r\n\r\n<em>All Raster Images, fish icon, and fish in the water are not mine, they were attained from Google search so I don\'t own any rights to them.</em>\r\n\r\n<img class=\"wp-image-1760\" src=\"http://localhost/wp-content/uploads/2018/01/infographic_export.png\" alt=\"\" width=\"800\" height=\"1726\" />\r\n\r\n&nbsp;\r\n\r\nIf your Interested in this projects details here\'s a page with said information.\r\n\r\n<strong><a class=\"row-title\" href=\"http://localhost/amateur-anglers-details-page/\" aria-label=\"Amateur Anglers Details Page (Edit)\">Amateur Anglers Details Page</a></strong>', 'IMG-208 Project 1: Infographic', '', 'inherit', 'closed', 'closed', '', '1761-revision-v1', '', '', '2018-01-25 15:53:36', '2018-01-25 23:53:36', '', 1761, 'http://localhost/2018/01/25/1761-revision-v1/', 0, 'revision', '', 0),
