(1874, 1, '2018-01-25 16:42:03', '2018-01-26 00:42:03', '<h2>Project Summary</h2>\r\nCreate a logotype and package design for a product line that has a family of four items. (example 4 types of tea or coffee within a specific brand) Choose from list below. Your product line should somehow integrate a chosen interpretation of the four elements; Fire, Water, Earth and Air. Research the subject matter. You do not have to interpret the idea literally. It is important to tie them together visually with colour differentiation, pattern, common grid or other common design elements throughout but each of the 4 designs should have its own distinctive personality. Consider referencing historical styles, type or colour palette, if relevant. You will research and choose your own packaging but it must be suitable for your product. Consider environmentally sound solutions to packaging.\r\n\r\n&nbsp;\r\n<h3>The Work Involved</h3>\r\n<h3></h3>\r\n<h5 style=\"text-align: center;\">Mood Board\'s<img class=\"aligncenter wp-image-1848 size-large\" src=\"http://localhost/wp-content/uploads/2018/01/Mood-Boads-1024x329.jpg\" alt=\"\" width=\"640\" height=\"206\" /></h5>\r\n&nbsp;\r\n<h5 style=\"text-align: center;\">Research</h5>\r\n<p style=\"text-align: center;\"></p>', 'Project 2 Details Page', '', 'inherit', 'closed', 'closed', '', '1834-revision-v1', '', '', '2018-01-25 16:42:03', '2018-01-26 00:42:03', '', 1834, 'http://localhost/2018/01/25/1834-revision-v1/', 0, 'revision', '', 0),
